import React, { useEffect, useState } from "react";
import userApi from "../../../api/api-user-setting";

export default function Setting() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    userAll();
  }, []);

  const userAll = async () => {
    await userApi.findOneUser(1).then((data) => {
      setUsers(data);
    });
  };
  console.info(users);
  return (
    <div className="ml-5">
      {/* Logo */}
      <div
        className="mt-6  <div>
        <div>
          <h2>Profile</h2>
        </div>
        <div>
          <p>{users.user_name}</p>
          {users.users_emails &&
            users.users_emails.map((email, index) => {
              return (
                <>
                  <div key={index}>
                    <p>{email.pmail_address}</p>
                  </div>
                </>
              );
            })}
          {users.users_experiences &&
            users.users_experiences.map((exp, index) => {
              return (
                <>
                  <div key={index}>
                    <p>{exp.usex_title}</p>
                    <p>{exp.usex_profile_headline}</p>
                  </div>
                </>
              );
            })}
          {users.users_address &&
            users.users_address.map((address, index) => {
              return (
                <>
                  <div key={index}>
                    <p>{address.etad_addr_id}</p>
                  </div>
                </>
              );
            })}
        </div>
      </div>"
      >
        <span className="border border-slate-500 p-2 rounded-full px-5 "></span>
        <p>Code Academy</p>
      </div>
      <div>
        <p className="mt-6">Home / Setting</p>
      </div>
    </div>
  );
}
